import React, {Component} from "react";
import Button from "../buttons/Button";

class CreatePoll extends Component {
    constructor() {
        super();

        this.state = {
            new: "",
        };
    }

    render() {
        return (
            <div class="container">

                <h2 class="headline"></h2>

                <form>
                    <Button type = {'new poll'} title = {'New'} />
                </form>
            </div>
        );
    }
}

export default CreatePoll;
